<!-- 
    base64 转 file
    参考文章：
        https://blog.csdn.net/jeft_hai/article/details/97671404 img 格式相互转换 url, base64，blob, file
        https://juejin.cn/post/7080898368712491038 arrayBuffer？Uint8Array？嘛玩意儿
 -->
<template>
    <div class="base64-to-file">
        <textarea
            name=""
            id=""
            cols="30"
            rows="10"
            placeholder="输入base64"
            v-model="base64Str"
        ></textarea>
        <button @click="execParse">base64转换为file</button>
        <img :src="outputHref" alt="" />
    </div>
</template>

<script>
export default {
    name: "base64-to-file",
    data() {
        return {
            base64Str: base64Str,
            outputHref: ""
        };
    },
    methods: {
        Base64toFile(dataurl, filename) {
            const arr = dataurl.split(","),
                mime = arr[0].match(/:(.*?);/)[1], // 获取图片格式
                bstr = atob(arr[1]); // window.atob() 方法用于解码使用 base-64 编码的字符串
            let n = bstr.length,
                u8arr = new Uint8Array(n); // Uint8Array表示把ArrayBuffer的每个字节（byte，8-bit）当成一个无符号整型数，指的范围是0-255
            while (n--) {
                u8arr[n] = bstr.charCodeAt(n); //返回指定位置的字符的 Unicode 编码
            }
            return new File([u8arr], filename, { type: mime });
        },
        execParse() {
            const file = this.Base64toFile(this.base64Str, "test.jpg");
            this.outputHref = URL.createObjectURL(file);
        }
    }
};

const base64Str =
    "data:image/jpeg;base64,";
</script>
